css:
/* Цвет значения в CSS, базовые значения в js(цифры),
                                   Свойства у Math+Number, числовые значения в JSON */
/* var, function, селектор тега, return, true, false, if, for, continue,
                                   квантификаторы в RegExp, true/false в JSON */
atom-text-editor {
  background-color: #090b0d;
  color: #DCDCDC;
}
atom-text-editor .cursor {
  border-color: #DCDCDC;
}
atom-text-editor .selection .region {
  background-color: #264F78;
}
atom-text-editor .line-number.cursor-line-no-selection {
  background-color: #0f0f0e;
}
atom-text-editor .line.cursor-line {
  box-sizing: border-box;
  background-color: #0f0f0e;
  box-shadow: inset 0 0 0 2px #262222;
}
atom-text-editor .line-number {
  color: #2B91AF;
}
atom-text-editor .indent-guide {
  color: #165060;
}
atom-text-editor .syntax--text {
  color: #d87925;
}
atom-text-editor .syntax--keyword.syntax--operator.syntax--js,
atom-text-editor .syntax--entity.syntax--name.syntax--tag,
atom-text-editor .syntax--constant.syntax--other,
atom-text-editor .syntax--source.syntax--php.syntax--embedded.line,
atom-text-editor .syntax--variable.syntax--parameter,
atom-text-editor .syntax--meta.syntax--tag,
atom-text-editor .syntax--declaration.syntax--tag,
atom-text-editor .syntax--definition,
atom-text-editor .syntax--attribute-name,
atom-text-editor .syntax--source,
atom-text-editor .syntax--doctype {
  color: #F1F2F3;
}
atom-text-editor .syntax--comment {
  color: #57A64A;
}
atom-text-editor .syntax--comment.syntax--doctype {
  color: #F1F2F3;
}
atom-text-editor .syntax--support.syntax--other.syntax--variable,
atom-text-editor .syntax--string.syntax--other.syntax--link,
atom-text-editor .syntax--entity.syntax--name.syntax--tag,
atom-text-editor .syntax--entity.syntax--name.syntax--filename.syntax--find-in-files {
  color: #569CD6;
}
atom-text-editor .syntax--string.syntax--regexp,
atom-text-editor .syntax--meta.syntax--link {
  color: #D69D85;
}
atom-text-editor .syntax--constant.syntax--numeric,
atom-text-editor .syntax--support.syntax--constant,
atom-text-editor .syntax--punctuation.syntax--section.syntax--embedded,
atom-text-editor .syntax--keyword.syntax--other.syntax--unit,
atom-text-editor .syntax--entity.syntax--name.syntax--interface,
