  color: #4EC9B0;
}
atom-text-editor .syntax--string,
atom-text-editor .syntax--constant.syntax--other.syntax--symbol,
atom-text-editor .syntax--constant.syntax--character,
atom-text-editor .syntax--entity.syntax--other.syntax--inherited-class,
atom-text-editor .syntax--markup.syntax--heading,
atom-text-editor .syntax--constant.syntax--numeric.line-number.syntax--match.syntax--find-in-files {
  color: #D69D85;
}
atom-text-editor .syntax--keyword,
atom-text-editor .syntax--storage,
atom-text-editor .syntax--entity.syntax--name.syntax--tag.syntax--css,
atom-text-editor .syntax--constant.syntax--language,
atom-text-editor .syntax--keyword.syntax--operator,
